Kebersihan tangan adalah hal yg sangat penting utk melawan berbagai penyakit - namun, 1 dari 4 orang di Indonesia tdk memiliki akses ke fasilitas cuci tangan. 

@UNICEF turut berperan untuk mewujudkan kebersihan tangan bagi seluruh masyarakat Indonesia.

https://t.co/mqBIXEp6dX

@antaranews KPU, KPUD, KPPU juga patuhi protokol kesehatan. Jangan berkerumun, jaga jarak, pake masker, setiap selesai memberi kertas langsung cuci tangan ya.
Tapi terhadap hasil pemilukada nanti nggak boleh cucitangan ya.
Salam sehat. !!

